package io.connectedhealth.idaas.hcdataobjects.common;import java.util.List;public class EncounterR3 {    public String resourceType;    public String id;    public Meta meta;    public List<Identifier> identifier;    public String status;    public List<Type> type;    public Subject subject;    public Period period;    public List<Location> location;    public String getResourceType() {        return resourceType;    }    public void setResourceType(String resourceType) {        this.resourceType = resourceType;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public Meta getMeta() {        return meta;    }    public void setMeta(Meta meta) {        this.meta = meta;    }    public List<Identifier> getIdentifier() {        return identifier;    }    public void setIdentifier(List<Identifier> identifier) {        this.identifier = identifier;    }    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    public List<Type> getType() {        return type;    }    public void setType(List<Type> type) {        this.type = type;    }    public Subject getSubject() {        return subject;    }    public void setSubject(Subject subject) {        this.subject = subject;    }    public Period getPeriod() {        return period;    }    public void setPeriod(Period period) {        this.period = period;    }    public List<Location> getLocation() {        return location;    }    public void setLocation(List<Location> location) {        this.location = location;    }}